import React, { useState } from "react";
import axios from 'axios';
import { Link } from 'react-router-dom';
import "./Logsig.css";
import sign from "./signin.png";

function Mainsignin() {

  co
  const [email, setEmail] = useState('');
  const [username, setUserName] = useState('');
  const [password, setPassword] = useState('');
  const [confirm, setConfirmpassword] = useState('');

  const sendData = async (email) => {
    try {
      // Assuming you want to send an object containing the email
      await axios.post("http://localhost:8000/signup", { email });
      // Handle success or any other actions here
    } catch (error) {
      // Handle errors here
      console.error(error);
    }
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    sendData(email); // Call the sendData function here
  }

  return (
    <>
      <div>
        <form className="form" method="post" onSubmit={handleSubmit}>
          <h1 className="header22">SIGNUP</h1>
          <div className="flex-column">
            <label>Username</label>
          </div>
          <div className="inputForm">
            <input
              required
              placeholder="Enter your Name"
              className="input"
              type="text"
              value={username}
              onChange={(e) => setUserName(e.target.value)}
            />
          </div>

          <div className="flex-column">
            <label>Email ID</label>
          </div>
          <div className="inputForm">
            <input
              required
              placeholder="Enter your Email (clg Mail)"
              className="input"
              type="text"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
            />
          </div>
          <div className="flex-column">
            <label>Password</label>
          </div>
          <div className="inputForm">
            <input
              required
              placeholder="Enter your Password"
              className="input"
              type="text"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
            />
          </div>
          <div className="flex-column">
            <label>Confirm Password</label>
          </div>
          <div className="inputForm">
            <input
              required
              placeholder="Confirm Password"
              className="input"
              type="text"
              value={confirm}
              onChange={(e) => setConfirmpassword(e.target.value)}
            />
          </div>

          <button type="submit" className="button-submit">
            Sign In
          </button>

          <div className="login">
            <p>If existing user <Link to="/Mainlogin"><span>Login</span></Link></p>
          </div>
        </form>
      </div>
    </>
  );
}

export default Mainsignin;
